import React from 'react';
import Login from "../component/Login";

export default function Home({children}){
    const object={
        user:"ofirday@gmail.com",
        setUser:()=>{},
        reset:()=>{}
    }

    return(
        <UserContext.Provider value={object}>
        <h1>Login</h1>
        <Login/>
        </UserContext.Provider>

    )
}
